import { BrouserRouter, Router, Routes } from "react-router-dom";
import { Box } from "@mui/material";
const App = () => {
  <BrouserRouter>
    <Box sx={{ backgroundColor: "#000" }}>
      Navbar
      <Routes>
        <Route path="/" exact element={<Feed />}></Route>
      </Routes>
    </Box>
  </BrouserRouter>;
};
export default App;
